import React from "react";
import "./style.css";

function TitleBox () {
    return (
            <div id="text-box">
                <h2>Botanical image library</h2>
                <a href="/" alt="home"><h1>Truffle</h1></a>
            </div>
    );
}

export default TitleBox;
